 During the interwar period, Woolf was a significant figure in London literary society and a central figure in the influential Bloomsbury Group of intellectuals. Her most famous works include the novels Mrs Dalloway (1925), To the Lighthouse (1927) and Orlando (1928), and the book-length essay A Room of One's Own (1929), with its famous dictum, &quot;A woman must have money and a room of her own if she is to write fiction.&quot;
